import React from "react";
import ExpenseItem from "./ExpenseItem";
import Card from "../UI/Card";
import "./Expense.css";

const Expense = (props) => {
  return (
    <div>
      <Card className="expenses">
        <ExpenseItem title={props.items.title} date={props.items.date} />
        <ExpenseItem />
        <ExpenseItem />
        <ExpenseItem />
      </Card>
    </div>
  );
};

export default Expense;
